import React, { useState } from 'react';
import NavBar from '../NavBar/NavBar'; // NavBar 컴포넌트 임포트
import './SignupPage.css';

function SignupPage() {
  const [username, setUsername] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [phone, setPhone] = useState('');
  const [address, setAddress] = useState('');
  const [detailAddress, setDetailAddress] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // 회원가입 처리 로직 추가
  };

  return (
    <div className="SignupPage">
      <NavBar />
      <div className="signup-container">
        <h2>회원가입</h2>
        <div className="tab-buttons">
          <button className="tab-button active">일반 사용자 회원가입</button>
          <button className="tab-button">점주 회원가입</button>
        </div>
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="email">이메일</label>
            <input type="email" id="email" value={email} onChange={(e) => setEmail(e.target.value)} placeholder="이메일 입력" required />
            <button className="duplicate-check">중복</button>
          </div>
          <div className="form-group">
            <label htmlFor="password">패스워드</label>
            <input type="password" id="password" value={password} onChange={(e) => setPassword(e.target.value)} placeholder="패스워드 입력" required />
          </div>
          <div className="form-group">
            <label htmlFor="confirmPassword">패스워드 확인</label>
            <input type="password" id="confirmPassword" value={confirmPassword} onChange={(e) => setConfirmPassword(e.target.value)} placeholder="패스워드 확인" required />
          </div>
          <div className="form-group">
            <label htmlFor="username">이름</label>
            <input type="text" id="username" value={username} onChange={(e) => setUsername(e.target.value)} placeholder="이름 입력" required />
          </div>
          <div className="form-group">
            <label htmlFor="phone">연락처</label>
            <input type="tel" id="phone" value={phone} onChange={(e) => setPhone(e.target.value)} placeholder="연락처 입력" required />
          </div>
          <div className="form-group">
            <label htmlFor="address">주소</label>
            <input type="text" id="address" value={address} onChange={(e) => setAddress(e.target.value)} placeholder="주소 입력" required />
          </div>
          <div className="form-group">
            <label htmlFor="detailAddress">상세주소</label>
            <input type="text" id="detailAddress" value={detailAddress} onChange={(e) => setDetailAddress(e.target.value)} placeholder="상세주소 입력" required />
          </div>
          <button type="submit" className="signup-button">일반 사용자 회원가입</button>
        </form>
      </div>
    </div>
  );
}

export default SignupPage;
